import React, { Component } from 'react'
import Navbar from './components/Navbar'
import News from './components/news'
import './App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

export class App extends Component {
  render() {
    <Router></Router>
    return (
      <>
      <Navbar />
      <News pageSize={12} />
      </>
    )
  }
}

export default App
